import React, {useEffect} from 'react';
import {useSelector} from "react-redux"; 

const ProfileEditPage = ({history}) => {
    const user = useSelector(state => state.user)
    const {currentUser} = user

    useEffect(() => {
        if (!currentUser) {
            history.push("/")
        }
    }, [history, currentUser])
    return (
        <div>
            ProfileEditPage
        </div>
    )
}

export default ProfileEditPage
